',NULL,NULL,NULL,0,1,1,1,'2022-08-26 12:34:50','2022-07-29 04:46:48'),(4,2,3,NULL,NULL,'الأحكام والشروط','<p dir=\"rtl\" style=\"margin: 0px 0px 15px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">خلافاَ للإعتقاد السائد فإن لوريم إيبسوم ليس نصاَ عشوائياً، بل إن له جذور في الأدب اللاتيني الكلاسيكي منذ العام 45 قبل الميلاد، مما يجعله أكثر من 2000 عام في القدم. قام البروفيسور &quot;ريتشارد ماك لينتوك&quot; (Richard McClintock) وهو بروفيسور اللغة اللاتينية في جامعة هامبدن-سيدني في فيرجينيا بالبحث عن أصول كلمة لاتينية غامضة في نص لوريم إيبسوم وهي &quot;consectetur&quot;، وخلال تتبعه لهذه الكلمة في الأدب اللاتيني اكتشف المصدر الغير قابل للشك. فلقد اتضح أن كلمات نص لوريم إيبسوم تأتي من الأقسام 1.10.32 و 1.10.33 من كتاب &quot;حول أقاصي الخير والشر&quot; (de Finibus Bonorum et Malorum) للمفكر شيشيرون (Cicero) والذي كتبه في عام 45 قبل الميلاد. هذا الكتاب هو بمثابة مقالة علمية مطولة في نظرية الأخلاق، وكان له شعبية كبيرة في عصر النهضة. السطر الأول من لوريم إيبسوم &quot;Lorem ipsum dolor sit amet..&quot; يأتي من سطر في القسم 1.20.32 من هذا الكتاب.</p>\r\n\r\n<p dir=\"rtl\" style=\"margin: 0px 0px 15px; padding: 0px; text-align: justify; color: rgb(0, 0, 0); font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px;\">للمهتمين قمنا بوضع نص لوريم إبسوم القياسي والمُستخدم منذ القرن الخامس عشر في الأسفل. وتم أيضاً توفير الأقسام 1.10.32 و 1.10.33 من &quot;حول أقاصي الخير والشر&quot; (de Finibus Bonorum et Malorum) لمؤلفه شيشيرون (Cicero) بصيغها الأصلية، مرفقة بالنسخ الإنكليزية لها والتي قام بترجمتها هـ.راكهام (H. Rackham) في عام 1914.</p>',NULL,NULL,NULL,0,1,1,1,'2022-08-26 12:34:50','2022-04-07 10:59:40'),(5,1,0,NULL,'faqs','FAQs','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec scelerisque eros non mollis ultricies. Donec blandit, ex vitae sollicitudin semper, urna nisi dictum ligula, vitae tristique urna tortor luctus dui. Sed vestibulum eleifend libero eu convallis. 